// src/components/Home.js
import React from "react";
import Header from "./Header"; // Import the Header component
import "./../styles/Home.css"; // Import styles for the page

function Home() {
    const handleLogin = () => {
        // Redirect to your backend's OAuth endpoint
        window.location.href = "/auth";
    };

    return React.createElement(
        "div",
        { className: "home-container" },
        React.createElement(Header), // Include the Header component
        React.createElement(
            "div",
            { className: "home-content" },
            React.createElement("h1", null, "Welcome to Playlist Manager"),
            React.createElement(
                "p",
                null,
                "Manage your YouTube playlists with ease."
            ),
            React.createElement(
                "button",
                { className: "login-button", onClick: handleLogin },
                "Sign in with Google"
            )
        )
    );
}

export default Home;
